import reactRouterDom from 'react-router-dom';



const MainHeader = () => {
  return (
    <header className="header">
        <Button>
        <Link  to="/Detail">Menu</Link>
        </Button>

      <nav>

        <ul>

          <h3>

            <NavLink activeClassName="active" to="/VList">Vendor List</NavLink>
          </h3>
          <h2>
            <NavLink activeClassName='active' to="/VendorForm">Create Vendor</NavLink>
          </h2>
        </ul>

      </nav>

    </header>
  );
};

export default MainHeader;
